INSERT INTO header (table_name, header, description,url, category, detail_header, research, hour, analysed, enabled) VALUES ('usb-c-stick','USB-C-Stick','','../pages/usb-c-stick','Elektronik','Marke;Hardwareschnittstelle;Lesegeschwindigkeit;Speicherkapazität;Zusätzliche Info',36,44,340,False);
INSERT INTO `usb-c-stick` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/USB-C-Stick/SanDisk Ultra Dual USB-Laufwerk.webp;', 'SanDisk Ultra Dual USB-Laufwerk', 'https://www.amazon.de/SanDisk-Ultra-128GB-Flash-Drive/dp/B01M0QR22B/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=335O73GBRY751&keywords=SanDisk+Ultra+Dual+USB-Laufwerk&qid=1667662388&sprefix=sandisk+ultra+%2Caps%2C218&sr=8-3', '16,87', 4.3, 10270, 2, 'SanDisk;USB 3.0;150 Megabytes Per Second;128 GB;Machen Sie mit dem USB 3.0 Stick Speicher auf Ihrem OTG-fähigen Smartphone frei. Dazu benötigen Sie nur Ihr Smartphone und schon exportieren Sie Ihre Daten zwischen Android Gerät und Computer.|Sie sind unterwegs und der Speicher ist schon wieder voll. Schließen Sie einfach das USB Laufwerk an Ihr Smartphone an. Ihre Bilder werden dank des USB 3.0 Anschlusses mit 150 MB/s gespeichert|Als mobiler Speicher eignet sich das USB Laufwerk ideal. Die Abwärtskompatibilität mit USB 2.0 Anschlüssen, macht die Smartphone Speichererweiterung sehr flexibel.|Verwalten und sichern Sie Ihre Inhalte problemlos über die SanDisk Memory Zone App. Sie ist als Download im Google Play Store erhältlich.|Lieferumfang: SanDisk Ultra Dual USB-Laufwerk m3.0 Smartphone Speicher 128 GB (Mobiler Speicher, USB m3.0, versenkbarer Doppelanschluss, 150 MB/s Übertragungsraten), 5 Jahre Garantie|Konnektivitätstechnologie: USB TYPE-A / MICRO-USB');
INSERT INTO `usb-c-stick` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (2, '../img/products/USB-C-Stick/Transcend JetFlash 890 .webp;', 'Transcend JetFlash 890 ', 'https://www.amazon.de/Transcend-TS32GJF890S-JetFlash-Speicherstick-Anschluss/dp/B01443P094/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=31SI7U6Y60EOQ&keywords=Transcend+JetFlash+890&qid=1667662395&sprefix=%2Caps%2C80&sr=8-3', '14,99', 4.3, 312, 3, 'Transcend;USB 3.0;90 Megabytes Per Second;32 GB;Design mit zwei Anschlüssen für die Übertragung zwischen USB Typ C- und USB 3.1 Gen 1-Schnittstellen|Kompakte COB-Fertigung (Chip On Board)|Bis zu 130MB/s Übertragungsgeschwindigkeit|Transcend Elite &amp; RecoveRx Software für einfaches Datenmanagement');
INSERT INTO `usb-c-stick` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (3, '../img/products/USB-C-Stick/Topesel USB-Stick 128 GB.webp;', 'Topesel USB-Stick 128 GB', 'https://www.amazon.de/TOPESEL-USB-Stick-Speicherstick-Wasserdicht-MacBook/dp/B07R3R56DS/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=OMS053624NZ1&keywords=topesel+usb-stick+128gb&qid=1667662402&sprefix=%2Caps%2C72&sr=8-3', '28,99', 4.3, 6102, 0, 'TOPESEL;USB, USB 3.0, USB 2.0;130 Megabytes Per Second;128 GB;【2-in-1 USB-Stick】: Dual Anschlüsse vom Typ C und USB 3.0 für die einfache Datenübertragung zwischen PC und OTG-fähigen Geräten vom Typ C, einschließlich Android-Smartphones, Tablets und Mac.|【Super Speed】: Die Lesegeschwindigkeit beträgt bis zu 130 MB/s und die Schreibgeschwindigkeit bis zu 35 MB/s. Sparen Sie Zeit und steigern Sie die Effizienz erheblich.|【Wasserdicht und Langlebig】: Als wasserdicht und stoßfest konzipiert, wird das Flash-Laufwerk nicht durch Wasser oder Regen beschädigt. Die Abdeckung besteht aus einer Aluminiumlegierung, die den USB-Speicher vor Kratzern schützt.|【Plug and Play】: Sie müssen keine zusätzliche Software installieren. Der USB-Speicherstick kann sofort erkannt und genutzt werden|【Tragbares Design】: Mit einer kleinen Schleife kann das USB-Speicherstick an einer Schlüsselkette aufgehängt und überall verwendet werden.');
INSERT INTO `usb-c-stick` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (4, '../img/products/USB-C-Stick/SanDisk Ultra Dual Drive USB Type-C.webp;', 'SanDisk Ultra Dual Drive USB Type-C', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MTo1Mzg5MjkwMDMwODA3MTc1OjE2Njc2NjI0MDc6c3BfYXRmOjIwMDU3Mjg1MTMzNTAzOjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FSanDisk-Ultra-128GB-Drive-Type-C%2Fdp%2FB0842P5GBQ%2Fref%3Dsr_1_2_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D3PT06TKQ8XM01%26keywords%3DSanDisk%2BUltra%2BDual%2BDrive%2BUSB%2BType-C%26qid%3D1667662407%26sprefix%3Dsandisk%2Bultra%2Bdual%2B%252Caps%252C88%26sr%3D8-2-spons%26psc%3D1', '19,89', 4.6, 10664, 1, 'SanDisk;USB;150 Megabytes Per Second;128 GB;Der Speicher Ihres Smartphones mit USB-Type-C ist voll? Stecken Sie einfach den Smartphone Speicher ein und übertragen Sie Daten auf den USB-Stick, um Speicherplatz auf Ihrem Smartphone freizugeben.|Ersparen Sie sich lange Wartezeiten und exportieren Sie von unterwegs aus Ihre Fotos. Mit diesem USB Laufwerk übertragen Sie Daten mit bis zu 150 MB/s.|Mit dem SanDisk Ultra Dual Drive Luxe mit Ganzmetallgehäuse können Sie Dateien mühelos zwischen Smartphone, Tablet und Mac mit USB Type-C und Computern mit USB Type-A übertragen.|Ein mobiler Speicher zum automatischen Sichern Ihrer Inhalte, ganz einfach über die SanDisk Memory Zone App. So gehen Ihre Daten nicht verloren, selbst wenn Sie Ihr Smartphone einmal verlieren sollten.|Lieferumfang: SanDisk Ultra Dual Drive Luxe USB Type-C-Laufwerk Smartphone Speicher 128 GB (Mobiler Speicher, drehbares Design, 150 MB/s Lesen, USB Laufwerk)');
INSERT INTO `usb-c-stick` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (5, '../img/products/USB-C-Stick/Kootion 128GB USB C Stick.webp;', 'Kootion 128GB USB C Stick', 'https://www.amazon.de/KOOTION-Memory-Flash-Laufwerk-Speicherstick-Notebook/dp/B07P993P47/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1NG23EAWS3YJE&keywords=Kootion+128GB+USB+C+Stick&qid=1667662413&sprefix=%2Caps%2C78&sr=8-3', '21,99', 4.3, 3175, 0, 'Kootion;USB, USB 3.0, USB 2.0;90 Megabytes Per Second;128 GB;【2-in-1 USB Stick】: USB-Speicherstick 3.0 128GB mit dual USB Typ C Schnittstelle und USB 3.0 A Anschluss zum einfachen Übertragen von Daten zwischen PC und Smartphone, Tablet und Mac.|【High Speed】: Lesegeschwindigkeit bis zu 90 MB / s und Schreibgeschwindigkeit bis zu 30 MB / s.|【Plug and Play】: Zum Tauchen ist keine zusätzliche Software erforderlich. Kompatibel mit OTG-fähigen Typ C Smartphones, Tablets und Macs, Geeignet systemen für Android, Windows, Linux.|【Elegant &amp; Tragbar】: Schöne Studie Kunstharzschale. Sie können den USB-Speicherstick an den Schlüsselbund oder Ihre Tasche hängen und bequem überall verwenden.|【1 Jahr Garantie】: Wir geben Ihnen eine Rückerstattung oder einen Ersatz, wenn Sie einen defekten Artikel erhalten haben. Bitte zögern Sie nicht uns zu kontaktieren, wir sind in 24 Stunden in Bereitschaft.');
INSERT INTO `usb-c-stick` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (6, '../img/products/USB-C-Stick/Didivo USB-C-Stick 128GB.webp;', 'Didivo USB-C-Stick 128GB', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MTo5MDAzOTQzMjc2NDEyNDA6MTY2NzY2MjQyMTpzcF9hdGY6MjAwNjk3OTU5NTI5OTg6OjA6Og&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FDIDIVO-Laufwerk-C-Speicherstick-Pen-Laufwerk-USB-C-Smartphones-Silver%2Fdp%2FB08J7Q9B4G%2Fref%3Dsr_1_2_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3D1FEJ5IPJXNIR2%26keywords%3DDidivo%2BUSB-C-Stick%2B128GB%26qid%3D1667662421%26sprefix%3D%252Caps%252C94%26sr%3D8-2-spons%26psc%3D1', '23,89', 4.3, 1516, 0, 'DIDIVO;USB 3.0;80 Megabytes Per Second;128 GB;【2-in-1-USB-OTG-Dual-USB-Stick】 Der USB-C-Stick 128 GB mit USB 3.0- und Typ-C-Schnittstelle, Photo Stick für Computer und Photo Stick für Android-Telefone. Sie können stattdessen problemlos Dateien und Daten zwischen Smartphones, Tablets und Computern übertragen Durch die Verwendung von WLAN- und Cloud-Diensten können Sie die Dateiübertragungszeit effizient sparen und die Arbeitseffizienz erheblich verbessern.|【128 G starker Speicher】 Mit diesem 128 GB USB C-Stick können Sie mehr als 7200 Fotos, 320 Minuten + HD-Videos, 8000 + Songs, 32 GB Office-Dateien speichern. Bietet bis zu 80 MB / s Lesegeschwindigkeit und 15-60 MB / s Schreibgeschwindigkeit und ermöglicht das Übertragen großer Dateien vom USB-Stick in kürzerer Zeit. Sparen Sie mehr Zeit und Mühe beim Übertragen und Hochladen von Dateien.|【Breite Kompatibilität und Plug &amp; Play】 Funktioniert für USB C-Geräte wie Huawei Matebook, Google Chromebook Pixel, New Macbook Pro und Samsung. Arbeiten Sie für USB 3.0-Geräte wie Desktop-Computer, Laptop, Macintosh, Lautsprecher, Drucker, Auto-Videosystem, Smart-TV. Plug &amp; Play, keine Notwendigkeit, Software zu installieren, ideal für Reisende, Fotografen, Büroangestellte, Studenten.|【Hochwertiges Metallgehäuse und Schlüsselringdesign】 Das 128-GB-USB-Stick-Gehäuse besteht aus einer hochwertigen Zinklegierung, wodurch das USB-Laufwerk extrem robust und langlebig ist Der Antrieb dreht sich zufällig. Sie können das USB-Stick des USB-Sticks mit dem Aufhängering an eine Schlüsselkette hängen.|【1 Jahr kostenlose Garantie】 Wir bieten Ihnen 12 Monate sorgenfreie Garantie, professionellen Kundenservice und kontaktieren Sie uns jederzeit, wenn Sie auf ein Problem stoßen. Hinweis für AnsprechpartnerDas Standarddateiformat des USB C-Speichersticks ist exFAT, das von Smartphones und Geräten erkannt wird Tablets. Wenn Ihr Gerät das USB-Flash-Laufwerk vom Typ C nicht erkennt, versuchen Sie, es mit NTFS oder FAT32 zu formatieren.');
INSERT INTO `usb-c-stick` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (7, '../img/products/USB-C-Stick/Samsung MUF-128DA/APC.webp;', 'Samsung MUF-128DA/APC', 'https://www.amazon.de/Samsung-Storage-MUF-128DB-EU-Speicherstick/dp/B07FCDTTYP/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1IF0WH5AJQR64&keywords=Samsung+MUF-128DA%2FAPC&qid=1667662426&sprefix=%2Caps%2C68&sr=8-2', '40,20', 4.5, 1376, 0, 'Samsung;USB 3.0;300 Megabytes Per Second;128 GB;Starke Leistung: Bis zu 300 MB/s Lesegeschwindigkeit mit USB 3.1 Schnittstelle (abwärtskompatibel zu USB 3.0 und 2.0)|Hohe Kompatibilität: USB-Typ-C- und Typ-A-Anschluss für einen flexiblen Einsatz am PC, Notebook, Smartphone und Tablet|Viel Platz für Ihre Daten: Bis zu 256 GB Speicherkapazität für Ihre wichtigsten Dateien zum Mitnehmen|Hohe Performance: Eine 3 GB große Datei kann vom USB Flash Drive auf ihren PC oder Laptop in etwa 10 Sekunden kopiert werden|Bewährte Zuverlässigkeit dank Fünf-fach Schutz: Wasserfest, stoßfest, magnetresistent, temperaturbeständig und röntgensicher');
INSERT INTO `usb-c-stick` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (8, '../img/products/USB-C-Stick/SanDisk Ultra Dual Drive Go.webp;', 'SanDisk Ultra Dual Drive Go', 'https://www.amazon.de/SanDisk-Ultra-256GB-Drive-Flash-Laufwerk/dp/B07YYJL21Z/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=VFS70JGFXPBH&keywords=SanDisk+Ultra+Dual+Drive+Go&qid=1667662432&sprefix=%2Caps%2C76&sr=8-3', '29,79', 4.6, 19884, 0, 'SanDisk;USB 3.1 Typ A, USB-C;150 Megabytes Per Second;256 GB;Suchen Sie nach einem Speicher für USB Type-C- und Type-A-Geräte? Dieses USB Flash-Laufwerk vereinfacht die Datenübertragung zwischen Smartphone, Tablet sowie PC und sichert bis zu 256 GB Daten|Um Speicherplatz auf Ihrem Smartphone freizugeben oder Fotos, Videos, Musikdateien, Dokumente und Kontakte automatisch zu sichern, schließen Sie den mobilen Speicher einfach an|Das leistungsstarke 2-in-1-Flash-Laufwerk mit einem reversiblen USB Type-C- und einem herkömmlichen USB Type-A-Stecker bietet Lesegeschwindigkeiten von bis zu 150 MB/s für schnelle Datenübertragungen|Durch das drehbare Design werden zudem die Anschlüsse des Smartphone Speichers geschützt und der USB kann als Schlüsselanhänger verwendet werden|Lieferumfang: SanDisk Ultra Dual Drive Go USB Type-C 256 GB 2-in-1 Smartphone Speicher (150 MB/s, USB Type-C- und USB Type-A-Stecker, automatisches Backup, Mobiler Speicher)');
INSERT INTO `usb-c-stick` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (9, '../img/products/USB-C-Stick/SSK USB C Disk 128GB.webp;', 'SSK USB C Disk 128GB', 'https://www.amazon.de/SSK-Dual-Laufwerk-Drive-Speicherstick-Kompatibel-Thunderbolt/dp/B093KYTJN6/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=A48RCPDTN3UW&keywords=SSK+USB+C+Disk+128GB&qid=1667662438&sprefix=%2Caps%2C71&sr=8-3', '16,99', 4.4, 1265, 0, 'SSK;USB;150 Megabytes Per Second;128 GB;【Duales Laufwerk: USB C + USB 3.1】: Das USB-Flash-Laufwerk mit zwei Anschlüssen ist perfekt mit einem USB-C-Anschluss und einem USB-A / USB 3.1-Anschluss ausgestattet und ermöglicht eine bequemere Datenübertragung zwischen Smartphone / Tablet und Computer. Machen Sie sofort Speicherplatz frei oder verschieben Sie Bilder oder Filme schnell auf Ihrem OTG-fähigen Android-Telefon Typ C, Tablet, MacBook, Windows-Computer, Auto-Audiosystem, Smart-TV und mehr.|【Schnellere Übertragungsgeschwindigkeit】: Die USB 3.1-Lesegeschwindigkeit beträgt bis zu 150 MB / s (die Schreibgeschwindigkeit ist niedriger und variiert je nach Kapazität). Sie ist dreimal schneller als USB 2.0. Sie müssen nicht mehr lange warten, während Sie Dateien, Musik, Bilder und Filme übertragen. Es ist nicht erforderlich, Software oder APP für das Dual-Flash-Laufwerk zu installieren. Plug and Play, einfach zu bedienen.|【Robust und langlebig】: Das Gehäuse besteht aus einer hochwertigen Zinklegierung, wodurch der Typ C-Sprungantrieb extrem robust und langlebig ist. Es hat eine bessere Leistung in Bezug auf Wasserdichtigkeit, Stoßfestigkeit und schnelle Wärmeableitung als Kunststoffgehäuse.|【360 ° drehbares Design】: Der 2-in-1-Dual-USB-Speicherstick mit dem innovativen 360 ° -Drehungs-Anti-Lost-Clip-Design und dem 90 ° -Stickpunktdesign verhindert, dass sich das Laufwerk zufällig dreht. Sie können den USB C-Speicherstick an einen Schlüssel hängen Kette mit dem humanisierten Hängering.|【Breite Kompatibilität】: Der Typ C-Speicherstick ist kompatibel mit Computern, Laptops, Auto-Audiosystemen, Smart-TVs, OTG-fähigen Android-Typ C-Telefonen und Tablets. Es funktioniert mit iMac / MacBook / Pro / Air / Mini, iPad Pro, Chromebook Pixel usw.');
INSERT INTO `usb-c-stick` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (10, '../img/products/USB-C-Stick/Wansenda USB C Stick 512GB.webp;', 'Wansenda USB C Stick 512GB', 'https://www.amazon.de/WANSENDA-USB-Stick-Speicherstick-MacBook-Android/dp/B08K95VLNL/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=8RD5TKOC06MS&keywords=Wansenda+USB+C+Stick+512GB&qid=1667662451&sprefix=%2Caps%2C78&sr=8-3', '79,99', 4.2, 724, 0, 'WANSENDA;USB 3.0;-;512 GB;✔ 【Typ-C und USB 3.0】Duale Schnittstelle von USB Typ-C und Standard-USB 3.0. Zur einfachen Übertragung von Inhalten zwischen OTG-fähigen Android-Geräten, PC, Mac.|✔【Hochgeschwindigkeitsübertragung】Überlegene Geschwindigkeit USB 3.0 bietet eine schnellere Datenübertragung als USB 2.0, wenn unser USB-Speicherstick für Ihre Geräte verwendet wird und er ziemlich stabil ist.|✔ HINWEIS: * 12 Monate sorgenfreie Garantie * Sie können den erstklassigen USB-Speicherstick und einen besseren Service von uns erhalten. Wir können unser Bestes geben, um Probleme so schnell wie möglich zu lösen.|✔ 【Einfach zu bedienen】Plug und Play, keine Installation von Software erforderlich. Sie können die Speicher- und Transportfunktionen sinnvoll abschließen.|✔ 【Vielseitige Kompatibilität】 Unterstützt Windows 98, Windows 2000, Windows ME / XP / Vista, Windows 7/8/10, Mac OS 9.x / Linux 2.4 oder höher.');
INSERT INTO `usb-c-stick` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (11, '../img/products/USB-C-Stick/SanDisk Ultra USB Typ-C 128GB.webp;', 'SanDisk Ultra USB Typ-C 128GB', 'https://www.amazon.de/SanDisk-Ultra-Type-C-Flash-Laufwerk-150-MB/dp/B01BUSN07K/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2EXKSYCB8I8WM&keywords=SanDisk+Ultra+USB+Typ-C+128GB&qid=1667662459&sprefix=s%2Caps%2C137&sr=8-3', '20,29', 4.3, 1382, 0, 'SanDisk;USB 3.0;150 Unbekannt;32 GB;Konzipiert für Smartphones, Tablets und Computer mit dem neuen USB Typ-C-Anschluss|Machen Sie auf Ihrem Smartphone Speicherplatz frei oder übertragen Sie Dateien zwischen USB Typ-C-Geräten mit 16GB, 32GB, 64GB oder 128GB sofortigem Speicher|USB 3.1 Hochgeschwindigkeitsleistungen von bis zu 150 MB/Sek.');
